import {  MDBNavbar,MDBContainer,MDBRow, MDBCol, MDBCard, MDBCardBody, MDBMask, MDBIcon, MDBView, MDBBtn } from "mdbreact";
import React, { Component } from "react";
import ReactDOM from "react-dom";
import '@fortawesome/fontawesome-free/css/all.min.css';
import "bootstrap-css-only/css/bootstrap.min.css";
import "mdbreact/dist/css/mdb.css";

const App = () => {
  return (
   <MDBContainer  class="grey lighten-3">
  <MDBNavbar class="navbar fixed-top navbar-expand-lg navbar-light white scrolling-navbar">

  </MDBNavbar>
     </MDBContainer>
  );
}

export default App;
